import React from "react";
import { SignInButton, SignUpButton } from "@clerk/clerk-react";
import "./LandingPage.css";

export default function LandingPage() {
  return (
    <div className="landing-page">
      <div className="mission-card">
        <h1 className="title">Bloom Bazaar</h1>
        <p className="mission">
          Our mission is to empower women from remote areas to share their love
          of nature by uploading and selling plant-related products and
          decorations. Join us to grow a green and supportive community.
        </p>
        <div className="auth-buttons">
          <SignInButton>
            <button className="sign-in-btn">Sign In</button>
          </SignInButton>
          <SignUpButton>
            <button className="sign-up-btn">Sign Up</button>
          </SignUpButton>
        </div>
      </div>
    </div>
  );
}
